style.css:
@-moz-document url-prefix("https://ubw.unit4cloud.com/es_mtv_prod_web/") {
table.MainTable {
	width: 100%
}

#b__horiz_89 th.GridCell {
	width: 10px !important
}

#b__horiz_89 .GridCell:first-child {
	width: 0px !important
}

/* Rejected */
#b__horiz_89 th[id*="headerwf_icons"].GridCell {
    width: 5px !important
}

/* description */
#b__horiz_89 .GridCell:nth-child(8) {
	width: 110px !important
}

/* work order */
#b__horiz_89 .GridCell:nth-child(5) {
	width: 15px !important
}

/* activity */
#b__horiz_89 .GridCell:nth-child(7) {
	width: 11px !important
}

/* time code */
#b__horiz_89 .GridCell:nth-child(4) {
	width: 12px !important
}
}
